import { Link } from 'react-router-dom';

const MovieList = ({ movies }) => {
  const urlRegex = /\s/g;
  let title = title.toLowerCase().replace(urlRegex, '-');
  return (
    <div className="blog-list">
      {movies.map(movie => (
        <div className="blog-preview" key={movie.title.toLowerCase().replace(urlRegex, '-')} >
          <Link to={`/movies/${movie.title.toLowerCase().replace(urlRegex, '-')}`}>
            <h2>{ movie.title }</h2>
          </Link>
        </div>
      ))}
    </div>
  );
}
 
export default MovieList;
